환자 여러분의 건강과 안전을 최우선으로 생각하며, 새로운 환경에서 더욱 향상된 서비스를 제공할 수 있도록 최선을 다하겠습니다. 많은 관심과 성원 부탁드립니다.
감사합니다.', SYSDATE, SYSDATE, '5', 'Y', '알림판');

